Rust has if expressions Rust if evaluations expect a bool, and integers will not be casted to bool. // If example
fn main() { let number = 3; if number < 5 { println!("condition was true"); } else { println!("condition was false"); }
} // If bool requirement
fn main() { let number = 3; if number { println!("number was three"); }
} // If-else example
fn main() { let number = 6; if number % 4 == 0 { println!("number is divisible by 4"); } else if number % 3 == 0 { println!("number is divisible by 3"); } else if number % 2 == 0 { println!("number is divisible by 2"); } else { println!("number is not divisible by 4, 3, or 2"); }
} // If expression example
fn main() { let condition = true; let number = if condition { 5 } else { 6 }; println!("The value of number is: {number}");
} // If expression all blocs should return the same value
fn main() { let condition = true; let number = if condition { 5 } else { "six" }; println!("The value of number is: {number}");
}

