A set of rules that govern how a Rust program manages memory The rules are: Each value in Rust has an owner. There can only be one owner at a time. When the owner goes out of scope, the value will be dropped. Examples: let x = "Something".to_string();
let y = x; // Ownership of String "Something" is given to variable y.
println!("x: {}", x); // This will fail because x no longer is owner of "Something". { // s is not valid here, it’s not yet declared let s = "hello"; // s is valid from this point forward // do stuff with s
} // this scope is now over, and s is no longer valid
println!("s: {}", s); // This will fail because s is no longer in scope. fn something(x: String) { println!("x: {}", x);
} fn main() { let y = "something".to_string(); something(y); // y ownership is given to the function something. println!("y: {}", y); // This will fail because y no longer is owner of "something".
} As you can see Rust handled the allocation and deallocation of the variables thanks to the ownership system.

